from Crypto.Util.number import *
from secret import flag, e

m = bytes_to_long(flag)
p = getPrime(512)
q = getPrime(512)
n = p * q
c = pow(m, e, n)
E = pow(e, c, n)
print("p+q=", p + q)
print("n =", n)
print("E=", E)
print("c=", c)


